INSERT INTO `soal` VALUES   ('40','1','1','Hak asasi manusia adalah seperangkat hak yang melekat pada hakikat keberadaan manusia sebagai mahluk Tuhan Yang Maha Esa dan merupakan anugerah-Nya yang wajib dihormati, dijunjung tinggi dan dilindungi oleh negara, hukum, pemerintah, dan setiap orang demi kehormatan serta perlindungan harkat dan martabat manusia, merupakan pengertian HAM menurut ....','1','Komisi HAM PBB','Koentjoro Poerbopranoto','John Locke','UU No. 39 tahun 1999','Aristoteles','D','','','','','','','');
INSERT INTO `soal` VALUES ('41','1','3','Salah satu contoh pelaksanaan Hak Asasi Manusia bidang sosial dan budaya adalah ....','1','Mendapat pengajaran','Memilih perguruan tinggi negeri','Mendapatkan pengajaran dan mengembangkan kebudayaan','Mengembangkan kebudayaan','Mendapatkan pendidikan secara gratis','C','','','','','','','');
INSERT INTO `soal` VALUES ('42','1','4','Faktor aparat dan penindakannya (law enforcement) merupakan salah satu hambatan dalam penegakan HAM di Indonesia, yaitu berupa ....','1','Waktu yang belum optimal','Tingkat pendidikan heterogen','Prosedur kerja terbagi-bagi','Sering memberi kemudahan','Tidak taat asas dan aturan','E','','','','','','','');
INSERT INTO `soal` VALUES ('43','1','5','Salah satu upaya pemajuan, penghormatan, dan penegakan HAM di Indonesia, yaitu dibuatnya peraturan perundang-undangan tentang Hak Asasi Manusia yang diatur dalam ....','1','UU No. 5 Tahun 1998','UU No. 39 Tahun 1999','Keppres No. 181 tahun 1998','Keppres No. 129 Tahun 1999','UU No. 26 Tahun 2000','B','','','','','','','');
INSERT INTO `soal` VALUES ('44','1','6','Kejahatan berat yang menjadi keprihatinan masyarakat internasional adalah ....','1','Genocida','Sindikat narkotika dan obat-obatan terlarang','Pencurian uang di bank internasional','Pembunuhan terhadap orang asing','Pelecehan nama baik kepala negara','A','','','','','','','');
INSERT INTO `soal` VALUES ('45','1','7','Sebagai bentuk perhatian pemerintah Indonesia terhadap penegakan Hak Asasi Manusia adalah ....','1','mengembangkan kebebasan pers','Membentuk Komnas HAM dan pengadilan HAM','Memasukkan pendidikan kewarganegaraan di sekolah','Mengekang pengunjuk rasa dengan menggunakan kekerasan','Memilih jaksa agung yang berani','B','','','','','','','');
INSERT INTO `soal` VALUES ('46','1','8','Politik perbedaan warna kulit pernah diterapkan di Afrika Selatan merupakan contoh kejahatan kemanusiaan yang berat. Politik tersebut lazim disebut ....','1','Genocida','Aneksasi','Projustisia','Koneksitas','Apartheid','E','','','','','','','');
INSERT INTO `soal` VALUES ('47','1','9','Piagam Hak Asasi Manusia sedunia tercantum dalam ....','1','Bill of Right','Declaration of Independence','Magna Charta','Declaration des Droit de Lhomme et du Citoyen','Universal Declaration of Human Right','E','','','','','','','');
INSERT INTO `soal` VALUES ('48','1','10','Peristiwa kejahatan berat yang berskala internasional penanganannya menjadi tanggung jawab ','1','Dewan Keamanan PBB','Pemerintah negara pihak yang menjadi korban','Pemerintah negara tempat peristiwa','Pemerintah negara-negara didunia','Mahkamah Internasional','E','','','','','','','');
INSERT INTO `soal` VALUES ('49','1','11','Berikut ini adalah empat Hak Asasi Manusia yang disampaikan Franklin Delano Roosevelt adalah sebagai berikut, kecuali ....','1','Hak mengeluarkan pendapat','Hak menganut agama','Hak untuk berorganisasi','Hak bebas dari rasa takut','Hak mencukupi kebutuhan','C','','','','','','','');
INSERT INTO `soal` VALUES ('50','1','12','Contoh sikap menghormati pelaksanaan HAM yang sesuai dengan nilai-nilai Pancasila, antara lain ....','1','Melakukan musyawarah untuk mufakat','Cinta tanah air dan bangsa','Kerja keras dengan terpaksa','Menikmati hasil karya orang lain','Cinta sesama','A','','','','','','','');
INSERT INTO `soal` VALUES ('51','1','13','HAM dalam kehidupan sehari-hari yang sesuai dengan nilai Pancasila adalah...','1','Diberi kebebasan dalam memiliki harta','Boleh memeluk agama tanpa batasan','Kebebasan mengemukakan pendapat','Melaksanakan perubahan sesuai ajaran agama','Mempunyai martabat yang luhur','C','','','','','','','');
INSERT INTO `soal` VALUES ('52','1','14','Hambatan penegakan HAM di Indonesia yang berupa prinsip sipil antara lain ....','1','Masih lemahnya kesadaan hukum bagi masyarakat','Masih rendahnya keberanian masyarakat untuk melapor pelanggaran HAM','Hakim tidak dapat menentukan kesimpulan pelanggaran HAM','Belum adanya jaksa penuntut yang berpengalaman menanganinya','Lemahnya ekonomi masyarakat','B','','','','','','','');
INSERT INTO `soal` VALUES ('53','1','15','Berikut ini adalah contoh hak asasi di bidang politik, kecuali .','1','Hak ikut serta dalam pemerintahan','Hak memilih dalam pemilu','Hak dipilih dalam pemilu','Hak mendirikan partai politik','Hak memiliki sesuatu','E','','','','','','','');
