INSERT INTO `soal` VALUES ('768','13','1','Bacalah teks berikut!\nKreativitas pelajar dalam menciptakan peluang usaha perlu mendapat apresiasi positif. Kreativitas yang ditampilkan pada Pekan Kewirausahaan Pelajar di Kota Yogyakartaluar biasa. Antusiasme peserta untuk mengikuti kegiatan ini pun patut diberikan penghargaan. Kegiatan seperti ini merupakan salah satu persiapan menyongsong MEA dikalangan pelajar.\nMakna istilah apresiasi dan antusiasme adalah ','1','pendapatan dan semangat','penghargaan dan semangat','pendapatan dan dorongan','pandangan dan keinginan','penghargaan dan capaian','B','','','','','','','');
INSERT INTO `soal` VALUES ('769','13','2','Cermati paragraf berikut!\nTaman minimalis sering kali berkesan datar dan membosankan karena kesederhanaannya. Sebenarnya, taman minimalis bisa dirancang menjadi taman keluarga yang teduh nan menyejukkan. Pada prinsipnya, desain taman minimalis memaksimalkan pemanfaatan ruang terbuka dengan perawatan seminimal dan sehemat mungkin.\nMakna kata minimalis dan desain pada paragraf tersebut adalah ','1','sederhana dan rancangan','sederhana dan motif','murah dan corak','biasa dan pola','sederhana dan gaya','A','','','','','','','');
INSERT INTO `soal` VALUES ('770','13','3','bacalah teks berikut!\nBuah pome (pomegranate), di Indonesia dikenal sebagai buah delima merah yang banyak khasiatnya. Buah yang berasal dari daerah Timur Tengah kini dapat ditemukan di beberapa negara. Tak banyak yang tahu bahwa buah ini memiliki kandungan vitamin C yang lebih tinggi 25 kali daripada buah jeruk dan mengandung antioksidan 3 kali lebih tinggi daripada teh hijau. Rahasia lainnya buah ini telah lama dikenal sebagai pencegah penyakit kanker, jantung, dan darah tinggi.\nGagasan pokok teks tersebut adalah....','1','Khasiat buah delima merah','Buah delima merah dari Timur Tengah','Kandungan vitamin C delima merah','Buah pomegranate adalah buah delima merah','Buah delima mengandung antioksidan','A','','','','','','','');
INSERT INTO `soal` VALUES ('771','13','4','cermati paragraf berikut!\nMengatur waktu secara efektif itu tidak mudah. Kita perlu melatih diri dan memanfaatkan waktu dengan baik. salah satu cara yang bisa dilakukan adalah dengan manajemen waktu. Mengatur waktu bisa dilakukan dengan disiplin mengerjakan tugas atau kegiatan sesuai dengan jadwal yang telah ditetapkan.\nSimpulan yang sesuai dengan paragraf tersebut adalah ...','1','Waktu dapat digunakan secara efektif melalui kedisiplinan mengerjakan tugas.','Waktu akan mudah hilang apabila kita tidak dapat memanfaatkannya dengan baik.','manajemen waktu menjadi cara paling efektif dalam memanfaatkan waktu.','kegiatan harus dilaksanakan sesuai dengan jadwal yang ditetapkan.','jadwal harus dibuat sebaik mungkin agar waktu dapat digunakan secara efektif.','A','','','','','','','');
INSERT INTO `soal` VALUES ('772','13','5','Cermati kalimat berikut!\nKurangi polusi udara dengan cara bersepeda dan menggunakan kendaraan umum.\nInti kalimat tersebut yang tepat adalah ','1','Ajakan bersepeda','cara bersepeda','Kurangi polusi','Polusi udara','kendaraan umum','C','','','','','','','');
INSERT INTO `soal` VALUES ('773','13','6','Bacalah Ringkasan teks drama berikut!\nBudi : Andi setelah lulus mau kuliah lagi apa mau kerja?\nAndi : Mencari kerja biar tidak minta uang kepada orang tua.\nJoni     : Bagus dong Ndi, lagi pula untuk apa kamu kuliah kalau setelah lulus masih saja                                             menggantungkan diri kepada keluarga.\nAndi : Ya, terus kamu sendiri gimana Jon?\nJoni      : Urusan cari kerja sih, sudah dari dulu ada dipikiranku. Tapi, aku sendiri kan tidak seperti kamu. Aku tidak punya ijazah sarjana, SMK pun nilai ku tidak sebaik kamu, ya tidak heran kalau sampai sekarang masih saja jadi pengangguran\".\nBudi    : Iya, tapi banyak juga yang lulusan SMK yang berpenghasilan tinggi. Asal berusaha maksimal, suatu saat nanti kita pasti dapat pekerjaan yang layak. Atau, kita kolaborasi saja buat usaha patungan.\nRingkasan teks drama tersebut yang tepat adalah ','1','Andi, Joni, dan Budi membicarakan masa depan mereka. Mereka akan terus berusaha untuk mencari pekerjaan yang layak atau membuat usaha patungan.','Persoalan masa depan dibicarakan tiga orang sahabat, yaitu: Andi, Joni, dan Budi. Ketiganya sepakat untuk bersama-sama melanjutkan studi untuk meraih masa depan yang lebih baik.','Rasa tidak percaya Joni yang tidak memiliki ijazah sarjana membuatnya tidak dapat bergaul dengan teman-temannya. Padahal, mereka dulu sepakat untuk meraih gelar sarjana bersama.','Kesempatan bekerja dibicarakan oleh Andi, Joni, dan Budi. Mereka ingin membuat usaha yang akan membantu meraih masa depan yang telah dicita-citakan semenjak belajar di tingkat SMK.','Kesempatan bekerja telah dilalui oleh tiga orang sahabat, yakni Andi, Joni, dan Budi. Mereka mengharapkan hasil kerja kerasnya dapat terwujud dengan berbekal keterampilan pendidikan di SMK.','A','','','','','','','');
INSERT INTO `soal` VALUES ('774','13','7','Bacalah paragraf  berikut!\nPesta minuman keras itu tragis, tiga belas jiwa melayang dan lainnya mengalami keracunan yang  menyebabkan mual, pandangan kabur dan sesak nafas.  Hasil penelitian dilaboratorium minuman tersebut terdapat kandungan alkohol 200% jenis metanol. Disamping itu para korban  mengonsumsi miras tersebut ditambah dengan zat dan obat yang berbahaya.\nTanggapan yang logis terhadap paragraf  tersebut adalah ','1','Kalau sudah menjadi gaya hidup minumankeras sulit dihilangkan','Miras menyebabkan intobsikasi keracunan alkohol kepada peminum','Sudah cukup lama kebebasan pesta miras dilakukan mungkin hanya kecelakaan saja','Pemerintah dan tokoh masyarakat seharusnya melakukan penyuluhan','Biarlah menjadi pelajaran untuk yang lain','D','','','','','','','');
INSERT INTO `soal` VALUES ('775','13','8','Bacalah teks berikut!\nKita tidak dapat memungkiri kenyataan bahwa teknologi berkembang dengan pesatnya. Hal ini ditandai dengan banyaknya barang elektronik yang beredar di masyarakat. Pemunculan barang tersebut sudah sampai di kalangan masyarakat menengah ke bawah. Ada yang dikategorikan barang mewah dan ada pula yang dikategorikan bukan barang mewah.\nSimpulan isi teks di atas adalah ...','1','Teknologi canggih perlu dimiliki oleh masyarakat luas.','Keistimewaan alat itu sangat mencengangkan.','Perkembangan teknologi dewasa ini sangat pesat.','Sudah muncul lagi barang mewah baru.','Barang produksi Indonesia memang berat bersaing','C','','','','','','','');
