INSERT INTO `soal` VALUES ('777','13','10','Bacalah kutipan cerita pendek berikut!\nMakin ke ujung, kenduri makin sepi. Rombongan pengantar mempelai pria diam-diam juga kecewa pada tuan rumah, karena mereka hanya dijamu dengan menu masakan yang asal-asalan, kurang bumbu, kuah encer, dan daging yang tak kempuh. Padahal mereka bersemangat datang karena pesta perkawinan di Lareh Panjang mempunyai keistimewaan tersendiri, yaitu rasa masakan hasil olah tangan juru masak nomor satu. Siapa lagi kalau bukan Makaji?Kenapa Makaji tidak turun tangan dalam kenduri sepenting ini? begitu mereka bertanya-tanya.Sia-sia saja kenduri ini bila bukan Makaji yang meracik bumbu.Ah, menyesal kami datang ke pesta ini.\nMakna ungkapan turun tangan yang dalam kutipan teks cerpen tersebut adalah ...','1','meletakkan jabatan','Ikut membantu','mempergunakan','Kerja sama','kekuasaan','B','','','','','','','');
INSERT INTO `soal` VALUES ('778','13','11','Bacalah kutipan novel berikut!\nMasih dalam balutan baju kerja, aku tersungkur ke pangkuan Mbok Nah yang sedang nonton TV menungguiku pulang kantor sore ini. Sejak undangan cantik berwarna hijau itu diantar ke kantorku tadi pagi, tujuh puluh persen konsentrasiku hilang. Dan puncaknya aku tak tahan lagi menahan ekspresi wajahku di depan teman-temanku kalau aku sedang galau. Tangisku meledak ledak dan si Mbok membiarkan aku menangis, Muga-muga Den Laras diparingi (diberi) ikhlas, sambil tangannya mengelus-elus punggungku.\nMajas yang terdapat dalam kutipan novel tersebut adalah ...','1','Klimaks','Metafora','pleonasme','Hiperbola','Personifikasi','D','','','','','','','');
INSERT INTO `soal` VALUES ('779','13','12','Bacalah kutipan novel berikut!\nTahu-tahu Bang Nduk, pemilik warung Kupi Kuli yang kampungan minta ampun itu, telah memakai kaus polo dengan kerah berdiri juga. Rambutnya yang semula kusut bergumpal-gumpal macam pukat habis diterjang buaya, dipotong pendek tipis, ditaklukkan dengan likat minyak rambut Tancho hijau, lalu di-mohawk-kan. (Andrea Hirata: Sirkus Pohon\nUnsur intrinsik yang dominan dalam kutipan novel tersebut adalah ....','1','Alur','Latar','Tema','Penokohan','Cara bercerita','D','','','','','','','');
INSERT INTO `soal` VALUES ('780','13','13','Cermati kutipan novel berikut!\nAyah tiada. Kuyakin kau tahu, pernah kusurati engkau. Ia termasuk korban orang kalap di pasar. Di samping ayah, beberapa korban jatuh. Waktu itu beritanya tersinar luas. Tetapi, kehidupan keluarga kami tidak dapat berhenti dengan berita dan terali bagi pelakunya.\nPesan yang terdapat dalam kutipan novel tersebut adalah  ','1','Harus ada komunikasi yang baik kepada keluarga.','tidak boleh patah semangat saat menghadapi masalah.','keamanan lingkungan harus dapat ditingkatkan.','Berita tidak baik tidak perlu disiarkan ke masyarakat.','setiap pelaku kejahatan harus dihukum berat.','B','','','','','','','');
INSERT INTO `soal` VALUES ('781','13','14','cermati kutipan cerpen berikut!\nUtari sedang duduk di dekat perapian. Menyulam gambar bunga mawar pada sebidang kain satin. Pekerjaan yang selalu ia lakukan setiap hari. Ia membenci suara-suara angin itu dan segalanya tentang musim dingin. Ia tahu, tuhan meletakkan keindahan pada tempat-tempat yang tepat. Itu tdak dapat diragukan lagi, tapi hatinya yang muram hanya sanggup memandang keadaan dengan cara yang sama muramnya dengan hatinya.\nMakna tersurat yang disampaikan melalui kisah utari adalah ','1','kesetiaan seorang istri kepada suaminya.','kesedihan seorang wanita yang hidup sendiri di rumah.','ketelitian membuat sulaman pesanan orang lain.','kepandaian menggambar yang menjadi pekerjaan.','kehidupan seseorang di sebuah panti asuhan.','B','','','','','','','');
INSERT INTO `soal` VALUES ('782','13','15','cermati kutipan cerpen berikut!\nPergantian pemimpin diharapkan dapat membawa perubahan yang baik bagi warganya. Namun masih banyak pekerjaan rumah yang harus diselesaikan oleh pemimpin yang baru dilantik itu.\nMakna ungkapan pekerjaan rumah dalam kutipan cerita tersebut adalah  ','1','pekerjaan kantor yang dibawa pulang','pekerjaan yang dikerjakan di rumah','masalah yang belum diselesaikan ','pekerjaan yang sulit dikerjakan ','masalah yang sulit dicari solusinya ','C','','','','','','','');
INSERT INTO `soal` VALUES ('783','13','16','Bacalah kutipan novel berikut!\nKembali dari warung membawa obat dan makanan kudapati wanita itu berdiri di dalam kamar Mei. Matanya menyambut aku dengan kecurigaan. Aku beri hormat, rupanya ia tak mengerti kalau dihormati. Aku berusaha menahan diri.\nWatak tokoh aku pada teks tersebut adalah ','1','dermawan','Penyayang','penyabar','Toleran','Tabah','D','','','','','','','');
INSERT INTO `soal` VALUES ('784','13','17','Bacalah kutipan novel berikut!\nYusin menurunkan dua karung petai terakhir dari gendongannya. Sambil menyeka keringat, ia menghitung upah yang diangsurkan pembantu juragan petai. Matanya segera berkeliaran mengitari bagian  dalam pasar, mencari anaknya untuk makan siang. (Bumi pun Sekarat : Reza Yetty).\nLatar yang tampak dalam penggalan Novel tersebut adalah .    ','1','rumah juragan petai dalam pasar','rumah pembantu juragan petai','Rumah juragan petai','di sebuah pasar sayuran','Perkampungan dekat pasar','D','','','','','','','');
INSERT INTO `soal` VALUES ('785','13','18','Bacalah kutipan novel berikut!\nBoleh jadi. Aku masih juga heran tentang dirimu. Kau ini kemashuran telah kau peroleh di mana-mana. Orang datang padamu memohon jasa dan pertolongan. Semua orang memujamu. Tapi kamu tidak pernah ingat terhadap apa yng kau peroleh. Kau telah lupa yng di atas sana. Dirman hanya bisa diam. Sesaat ruang tamu itu kembali hening, suara jangkrik dimalam hari pun tidak mau bersaing dengan suara Kasman yang pelan dan pasti itu.\nKaitan amanat isi teks tersebut dengan kehidupan sehari-hari adalah ','1','Setiap orang harus bisa termashur agar dapat mencapai kebahagiaan hidup.','Orang yang memi ta jasa pada umumnya orang yang lemah.','Setiap orang harus ingat kepada Sang Pencipta apa pun keadaannya.','Orang yang selalu dipuja merupakan contoh orang yang baik dalam kehidupan.','Setiap makhluk hidup harus dihargai hak dan kewajibannya dalam kehidupan.','C','','','','','','','');
INSERT INTO `soal` VALUES ('786','13','19','Bacalah penggalan resensi buku kumpulan cerpen berikut!\n(1). Buku kumpulan cerpen hujan kepagian ini cukup menarik karena buku ini menceritakan kesaksian tentang revolusi kemerdekaan, (2). hanya sedikit karya sastra yang menampilkan kisah-kisah disekitar revolusi yang dialami oleh si pengarang, (3). bahasa yang digunakan pengarang sederhana, akan tetapi memikat, (4). selai itu, buku ini juga memiliki amanat yang mengajak generasi muda untuk tetap berjuang mempertahankan kemerdekaan kemerdekaan bangsa ini dan selalu berbuat baik, (5). suatu hal yang perlu menjadi catatan, seyogyanya tidak banyak menggunakan kosa kata belanda agar pembaca dapat dengan mudah memahami isinya.\nKeunggulan buku tersebut  terdapat pada kalimat nomor ....','1','1','2','3','4','5','C','','','','','','','');
INSERT INTO `soal` VALUES ('787','13','20','Cermati kutipan ulasan film berikut!\nFilm berlatar orang-orang Batak ini menonjolkan sisi orang Batak yang banyak bertaruh nasib di Jakarta.  Dengan menampilkan sisi-sisi orang batak itulah yang membuat film ini betul-betul menghibur. Para artis yang memerankan film ini banyak yang berasal dari Batak. Film ini menggandeng bintang muda Acha Septriasa sebagai pemain utama, yang memerankan tokoh Tias Siregar.  Dalam perannya, Acha bermain sebagai seorang pengacara yang sedang menjadi salah satu trending topic di media. Film Lamaran ini mengangkat tema drama komedi yang menggelikan. Banyak adegan lucu yang ditampilkan oleh pemeran yang memang sebagian adalah komedian.\nKutipan ulasan film tersebut berisi tentang ....','1','deskripsi film ','Kelemahan film','keunggulan film','Sinopsis film','Kritik film','C','','','','','','','');
INSERT INTO `soal` VALUES ('788','13','21','Cermati teks berikut!\nPenghargaan Nobel dianugerahkan setiap tahun kepada ilmuwan yang telah melakukan penelitian luar biasa. Penghargaan diberikan kepada orang yang menemukan teknik atau peralatan yang baru, atau telah melakukan kontribusi luar biasa bagi masyarakat. Saat ini Hadiah Nobel dianggap sebagai penghargaan tertinggi bagi orang yang mempunyai jasa besar kepada dunia.\nRingkasan teks tersebut yang tepat adalah .','1','Hadiah Nobel diberikan kepada orang yang ahli di bidang teknik yang berkontribusi kepada masyarakat dan ilmuwan yang berjasa kepada masyarakat/dunia.','Hadiah Nobel dianggap sebagai penghargaan tertinggi bagi orang yang mempunyai jasa besar kepada dunia dalam bidang teknik yang diberikan setiap tahun.','Setiap tahun Penghargaan Nobel dianugerahkan kepada ilmuwan yang telah berkontribusi kepada ahli di bidang teknik atau peralatan baru atau kepada dunia','Penghargaan Nobel dianugerahkan setiap tahun kepada ilmuwan yang telah melakukan penelitian luar biasa di bidang teknik atau peralatan baru atau berkontribusi kepada dunia.','Penghargaan Nobel dianugerahkan setiap tahun kepada ilmuwan yang telah melakukan penelitian di bidang teknik atau peralatan yang menguntungkan masyarakat.','A','','','','','','','');
INSERT INTO `soal` VALUES ('789','13','22','Cermati teks berikut!\nRumah besi, itulah julukan warga kampung Pondok Pucung, Tangerang Selatan, untuk kediaman arsitek ini. Struktur utama dari kolom, pembalokan hingga seluruh atapnya dibangun dari besi ringan. Atap besi ringan lebih ringan lebih murah dan pemasangannya pun prkatis.  (.).\nKalimat yang tepat untuk melengkapi paragraf deskripsi rumpang tersebut adalah ','1','Sebaliknya, atap kayu harganya semakin mahal dan pemasangannya ribet.','Sebaliknya, struktur atap kayu bila terkena hujan menjadi berat. ','Sebaliknya, kayu makin langka karena hutan sumber kayu semakin menyusut.','Seabaliknya, jumlah kayu berkualitas semakin langka dan harganya pun semakin mahal.','Selain itu, bambo bisa dijadikan solusi pembuatan atap murah selain besi','C','','','','','','','');
INSERT INTO `soal` VALUES ('790','13','23','Cermati teks berikut!\nWisata [ ... ] menjadi salah satu pilihan menarik ketika berlibur di Provinsi Kalimantan Tengah.Wisatawan dapat mencicipi masakan kepala ikan baung yang besarnya seukuran buah kelapa muda. Selain memiliki berbagai makanan [ ... ] yang nikmat dan lezat, provinsi ini memiliki tempat yang menarik yang wajib dikunjungi wisatawan, salah satunya adalah Jalan Yos Sudarso. \nIstilah yang tepat untuk melengkapi teks tersebut adalah ....','1','kuliner, khas','destinasi, khas','mancanegara, khas','kuliner, unik','mancanegara, unik','A','','','','','','','');
INSERT INTO `soal` VALUES ('791','13','24','Perhatikan kutipan berikut!!\nDampak paling nyata dari bencana asap adalah masalah kesehatan. Lebih dari tiga bulan terpapar udara bercampur asap membuat daya tahan masyarakat kian menurun.[...] Beberapa bantuan yang akan didistribusikan meliputi 125 ribu masker ke 97 kabupaten/kota terdampak, makanan tambahan 11 ton, alat penjernih air, serta 4482 oximetry (alat cek denyut jantung) dan sontheimer (alat menghitung kecepatan pernapasan anak-anak yang diperkirakan menderita ISPA. Selain itu, 70 unit alat penjernih udara (air purifier) untuk rumah sakit, oksigen konsentrate dan 500 unit kit penanggulangan asap ke puskesmas-puskesmas.\nKalimat yang tepat untuk melengkapi paragraf eksposisi di atas adalah....','1','Keadaan semakin parah, pemerintah tidak bisa berdiam diri melihat daerah-daerah terdampak kabut asap.','Melihat kondisi yang kian menghawatirkan, Menkes langsung menginstruksikan untuk kembali mengirim tambahan bantuan ke daerah-daerah terdampak kabut asap.','Bantuan-bantuan tambahan dari Pemerintah sangat bermanfaat bagi masyarakat yang tinggal di daerah terdampak kabut asap.','Kondisi semakin memprihatinkan, pemerintah daerah dan provinsi wajib meliburkan siswadi daerah terdampak kabut asap.','Pemerintah akan memberi Bantuan Santunan Kematian kepada korban meninggal akibat bencana asap.','B','','','','','','','');
INSERT INTO `soal` VALUES ('792','13','25','Perhatikan teks biografi berikut!\nperjalanan hidup Ki Hajar Dewantara benar-benar ditandai dengan perjuangan dan pengabdian pada kepentingan bangsa dan negara. Ki Hajar Dewantara menamatkan Sekolah Dasar di ELS (Sekolah Dasar Belanda), kemudian melanjutkan pendidikannya ke STOVIA (Sekolah Dokter Bumiputera). [] Akhirnya, ia bekerja sebagai wartawan di beberapa surat kabar, seperti Sedyotomo, Midden Java, De Express, Oetoesan Hindia, Kaoem Moeda, Tjahaja Timoer, dan Poesara.\nKalimat yang tepat untuk melengkapi teks tersebut adalah','1','Ia memilih menjadi wartawan daripada menjadi dokter.','Ia tidak dapat menamatkan pendidikan di sekolah tersebut.','Ia akhirnya menjadi dokter dan bekerja di rumah sakit.','Ia berhasil meraih gelar dokter pada sekolah dokter Bumiputera','Ia melanjutkan pendidikannya di sekolah kedokteran.','B','','','','','','','');
INSERT INTO `soal` VALUES ('793','13','26','Perhatikan kutipan teks ulasan berikut!\nBuku Remaja Membangun Kepribadian menarik untuk dibaca semua kalangan. Buku Remaja Membangun Kepribadian memiliki ciri khas dibandingkan buku lain psikologi remaja. Gaya bahasa penulis mudah dipahami oleh pembaca. [....] Sebagian besar buku psikologi remaja menyampaikan gagasan secara berbelit-belit.\nKalimat tepat untuk melengkapi resensi rumpang di atas adalah....','1','Berbagai jenis kecerdasan dan kemampuan dalam diri manusia dapat digunakan untuk mengembangkan diri.','Tidak hanya itu, pembahasan dalam Buku Remaja Membangun Kepribadian singkat sehingga pembaca mudah memahami maksudnya.','Dalam buku ini dibahas visi dan misi yang harus ada dalam setiap diri manusia agar dapat mengembangkan potensinya.','Gambar ilustrasi yang digunakan masih kurang sehingga memungkinkan terjadinya kepenatan pembaca.','Buku Remaja Membangun Kepribadian sebaiknya mengangkat berbagai peristiwa yang dekat dengan remaja saat ini.','B','','','','','','','');
INSERT INTO `soal` VALUES ('794','13','27','cermati teks prosedur berikut!\nCara menggunakan blender\n(1) Siapkan bahan yang ingin diblender.\n(2) Gunakan mangkuk blender yang sesuai. Mangkuk besar umumnya digunakan untuk memblender bahan basah, seperti tomat dan sebagainya. Sementara itu, mangkuk kecil untuk bahan kering, seperti merica dan lainnya.\n(3) Pasang mangkuk blender dengan tepat ke atas dudukan.\n(4) []\n(5) Tekan tombol ON pada blender.\n(6) Jika bahan sudah halus, tekan tombol OFF.\n(7) Angkat mangkuk blender dari dudukan.\n(8) Letakkan bahan yang sudah diblender ke mangkuk lain, kemudian bersihkan blender.\n(9) Simpan blender di tempat yang kering.\nPernyataan yang sesuai untuk melengkapi bagian rumpang teks prosedur tersebut adalah ','1','Pilihlah mangkuk yang sesuai.','Masukkan bahan-bahan ke dalam blender.','Tancapkan kabel ke dalam stop kontak.','Tutuplah blender dengan rapat.','Masukkan air jika diperlukan.','C','','','','','','','');
